import React from 'react';


const ImageLinkFrom = () => {
	return (
		<div style={{display:'flex', justifyContent:'center'}}>
		  <p>This Website will detect faces in your picture</p>
		  <div>
		    <input type='text' />
		  </div>
		</div>
	)
}

export default ImageLinkFrom;
